import React from "react";
import Quote from "quote";
function App(){
return(
<div className="quote-box">
    <Quote text="dsdd" author="jhjh"/>
    <button className="button tweet"></button>
    <button className="button tumbler"></button>
    <button className="button newquote"></button>
</div>
);
}
export default App;
